function AICCLoaded(n){var t="AICC response received!<br/>";for(const i in n)t+=i+": "+n[i]+"<br/>";document.getElementById("Response").innerHTML=t}var button=document.getElementById("AICCGet");button.onclick=function(){document.getElementById("Response").innerHTML="Sending AICC Get Request...";event.preventDefault();ajaicc.aiccGet(AICCLoaded)};button=document.getElementById("AICCPut");button.onclick=function(){document.getElementById("Response").innerHTML="Sending AICC Put Request...";var n=document.getElementById("Score").value,t=document.getElementById("Time").value;event.preventDefault();ajaicc.putAICC("","Y",n,t,"C",!1,AICCLoaded)};button=document.getElementById("AICCExit");button.onclick=function(){document.getElementById("Response").innerHTML="Sending AICC Exit Request...";event.preventDefault();ajaicc.exitAICC(AICCLoaded)};